eje Pogačara, který i přes pád\r\novládl pánskou obdobu tohoto závodu. Přitom i dámská verze Strade Bianche\r\nnabídla úchvatnou podívanou. Na toskánských prašných cestách jsme stejně jako v\r\nzávodě mužů sledovali extrémně náročný závod. Taky jsme byli svědky triumfu\r\nnejvětší favoritky, když Nizozemka Demi Vollering zaznamenala první velké\r\nvítězství v barvách týmu FDJ Suez.</b></p>\r\n\r\n<p class=\"MsoNormal\">Pro dámy <b style=\"mso-bidi-font-weight:normal\">italští\r\norganizátoři připravili 136km dlouho trasu, na níž na ženy čekalo hned 13\r\nprašných</b> úseků. Již z kraje závodu hýřil aktivitou tým FDJ Suez. Ten se\r\nsnažil posílat své závodnice do úniků tak, aby musel pracovat na čele pelotonu.\r\nTo se jim taky podařilo, když se <b style=\"mso-bidi-font-weight:normal\">mezi\r\nuprchlice nejdříve zařadila Juliette Labouse</b> a do následného úniku se\r\nprosmýkla i Évita Muzic.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Když se asi <b style=\"mso-bidi-font-weight:normal\">40km před\r\ncílem </b>utvořil nový únik, v němž figurovaly Francouzky Évita Muzic a Pauline\r\nFerrand Prévot, <b style=\"mso-bidi-font-weight:normal\">tak už se závodilo\r\nopravdu naplno</b>. V hlavní skupině začal uprchlíky nahánět tým SD Worx. Z\r\ntoho vyplynula redukce pelotonu na pouhých 15 závodnic. <b style=\"mso-bidi-font-weight:\r\nnormal\">S těmi nejlepšími se neudržela italská favoritka Longo Borghini.</b>\r\nZávod nedokončila Polka Katarzyna Niwiadoma, která skončila na zemi. Obdobný\r\nosud potkal i Lorenu Wiebes a Maďarku Vas.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Na metě <b style=\"mso-bidi-font-weight:normal\">13km před\r\ncílem</b> skupinka hlavních favoritek ztrácela na uprchlice pouze 20 sekund. V\r\nten moment <b style=\"mso-bidi-font-weight:normal\">začal štěrkový úsek s názvem\r\nLe Tolfe. Na něm zaútočila Nizozemka Demi Vollering</b>. Jako jediná se jí\r\ndokázala udržet pouze její krajanka <b style=\"mso-bidi-font-weight:normal\">Anna\r\nvan der Breggen</b>. Tato holandská dvojice s lehkostí předjela únik a mířila\r\nza vítězstvím.</p><p class=\"MsoNormal\"></p><p></p><div class=\"iframe\"><blockquote class=\"twitter-tweet\" data-media-max-width=\"560\"><p lang=\"en\" dir=\"ltr\">🥹 We know you missed this. We did too. <a href=\"https://twitter.com/hashtag/StradeBianche?src=hash&amp;ref_src=twsrc%5Etfw\">#StradeBianche</a> <a href=\"https://twitter.com/CA_Ita?ref_src=twsrc%5Etfw\">@CA_Ita</a> <a href=\"https://t.co/8TbLjIFAP6\">pic.twitter.com/8TbLjIFAP6</a></p>— Strade Bianche (@StradeBianche) <a href=\"https://twitter.com/StradeBianche/status/1898349899965456404?ref_src=twsrc%5Etfw\">March 8, 2025</a></blockquote> <script async=\"\" src=\"https://platform.twitter.com/widgets.js\" charset=\"utf-8\"></script> </div><p></p>\r\n\r\n<p class=\"MsoNormal\">Obě Nizozemky dojely pospolu až pod <b style=\"mso-bidi-font-weight:\r\nnormal\">závěrečný výjezd na Plaza del Campo.</b> V tu chvíli jejich náskok na\r\nostatní soupeřky činil necelé 2 minuty. V závěrečném výjezdu <b style=\"mso-bidi-font-weight:normal\">měla více sil Demi Vollering, která si tak\r\npřipsala již druhé vítězství na Strade Bianche</b>. Za druhou Nizozemkou van\r\nder Breggen dorazila na třetím místě Francouzka Ferrand Prévot.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Kompletní výsledky najdete<b style=\"mso-bidi-font-weight:\r\nnormal\"> <a href=\"https://www.procyclingstats.com/race/strade-bianche-donne/2025/result\" target=\"_blank\">ZDE</a></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Kolik výher letos\r\nzíská Demi Vollering?</b></p>\r\n\r\n    ', 6, 'strhujici-zaver-damske-verze-strade-bianche-preklopila-na-svou-stranu-demi-vollering');
